import React, { useState } from 'react';
import { createPatient } from "../services/PatientService";  // ✅ Correct import
import { useNavigate } from 'react-router-dom';

const AddPatientForm = () => {
  const navigate = useNavigate();

  const [patient, setPatient] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    age: '',
    gender: '',
    address: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setPatient((prevPatient) => ({
      ...prevPatient,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createPatient(patient);  // ✅ Correct function call
      alert('Patient added successfully!');
      navigate('/');  // Redirect to patient list
    } catch (error) {
      console.error('Error adding patient:', error);
      alert('Failed to add patient. Please try again.');
    }
  };

  return (
    <div className="container mx-auto p-5">
      <h2 className="text-2xl font-bold mb-4">Add New Patient</h2>
      <form onSubmit={handleSubmit} className="bg-white shadow-md rounded-lg p-8 max-w-lg mx-auto">
        <div className="grid grid-cols-2 gap-4">
          <div>
            <label>First Name:</label>
            <input
              type="text"
              name="firstName"
              value={patient.firstName}
              onChange={handleChange}
              required
              className="border p-2 w-full"
            />
          </div>

          <div>
            <label>Last Name:</label>
            <input
              type="text"
              name="lastName"
              value={patient.lastName}
              onChange={handleChange}
              required
              className="border p-2 w-full"
            />
          </div>

          <div>
            <label>Email:</label>
            <input
              type="email"
              name="email"
              value={patient.email}
              onChange={handleChange}
              required
              className="border p-2 w-full"
            />
          </div>

          <div>
            <label>Phone:</label>
            <input
              type="text"
              name="phone"
              value={patient.phone}
              onChange={handleChange}
              required
              className="border p-2 w-full"
            />
          </div>

          <div>
            <label>Age:</label>
            <input
              type="number"
              name="age"
              value={patient.age}
              onChange={handleChange}
              required
              className="border p-2 w-full"
            />
          </div>

          <div>
            <label>Gender:</label>
            <select
              name="gender"
              value={patient.gender}
              onChange={handleChange}
              required
              className="border p-2 w-full"
            >
              <option value="">Select</option>
              <option value="Male">Male</option>
              <option value="Female">Female</option>
              <option value="Other">Other</option>
            </select>
          </div>

          <div className="col-span-2">
            <label>Address:</label>
            <textarea
              name="address"
              value={patient.address}
              onChange={handleChange}
              required
              className="border p-2 w-full"
            />
          </div>

        </div>

        <div className="flex justify-between mt-6">
          <button type="submit" className="bg-green-500 text-white px-4 py-2 rounded-md hover:bg-green-600">
            Add Patient
          </button>
          <button type="button" onClick={() => navigate('/')} className="bg-gray-400 text-white px-4 py-2 rounded-md hover:bg-gray-500">
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
};

export default AddPatientForm;
